import React from "react";

function CompleteCount(props) {
  const setCount = props.setCount;
  return (
    <div className="count">
      <p onClick={() => setCount(5)}>Clear All</p>
      <img src="delete.png" alt="delet" className="count-del" />
    </div>
  );
}

export default CompleteCount;
